import { Container, ButtonGroup, Button } from "react-bootstrap";
import "../styles/css/Home.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faFacebook,
  faTwitter,
  faInstagram,
  // Add more social icons as needed
} from "@fortawesome/free-brands-svg-icons";

const Home = () => {
  return (
    <>
      <Container fluid className="home-main">
        <Container className="home-title">
          <h1>Hi, I'm Full Stack Developer !</h1>
        </Container>
        <Container className="home-subtitle">
          <h5>Akhilesh Kumbar</h5>
        </Container>
        <Container className="home-connect">
          <Button variant="primary" className="social-button">
            <FontAwesomeIcon icon={faFacebook} />
          </Button>{" "}
          <Button>Middle</Button>
          <Button>Right</Button>
        </Container>
      </Container>
    </>
  );
};
export default Home;
